import './personalDetails.css';
import 'font-awesome/css/font-awesome.min.css';

//<i className="fa fa-spinner fa-spin">no spinner but why</i>

const PersonalDetails = (props) => <div className="sideDetails"> 
    <i className="fa fa-user">           <a>  {props.details.Name}        </a></i>
    <i className="fa fa-phone">          <a>  {props.details.Phone}       </a></i>
    <i className="fa fa-envelope-open">  <a>  {props.details.Email}       </a></i>
    <i className="fa fa-birthday-cake">  <a>  {props.details.DateOfBirth} </a></i>
    <i className="fa fa-github">  <a> 
    href={props.details.Github}
    target="_blank" 
    >         {props.details.Github}
    </a></i>

</div>;

export default PersonalDetails;
